<td>对于所持有的链上积分，根据发放日期所属季度与当前季度之差，进行半衰期为一季度的计算后加总而得，以避免社区决策依赖于 (1) 过往积分数额较高的成员，或 (2) 已经不关心社区且不活跃的成员。</td>
